import React from 'react';
import LogoCarousel from '../components/common/LogoCarousel';
import ContainerNews from '../components/ContainerNews';
import CyberIncidentsStats from '../components/CyberIncidentStats';
import CybersecurityDashboard from '../components/CyberSecurityDashboard';
import PreviewWeb from '../components/sections/PreviewWeb';
import bgvideo from '../assets/videos/bgcyber.mp4';
import Navbar from '../components/common/navbar';
import WebsiteReview from '../components/WebReview';
import CoursesReview from '../components/CoursesReview';
import TestimonialsSection from '../components/CommentReview';
import { motion } from 'framer-motion';

function HomePage() {
  return (
    <div className="min-h-screen bg-[#0A1525]">
      <Navbar />
      
      {/* Hero Section with Video Background */}
      <div className="relative min-h-[90vh]">
        {/* Video Background */}
        <div className="absolute inset-0">
          <video 
            className="object-cover w-full h-full"
            autoPlay 
            muted 
            loop
            playsInline
          >
            <source src={bgvideo} type="video/mp4" />
          </video>
          <div className="absolute inset-0 bg-[#0A1525]/60"></div>
        </div>

        {/* Hero Content */}
        <div className="relative h-full">
          <div className="container px-8 pt-32 mx-auto">
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
              className="max-w-4xl mx-auto text-center"
            >
              <h1 className="mb-12 font-bold leading-tight text-white text-7xl">
                Your Informatics<br />
                Student<br />
                Performance<br />
                Center
              </h1>
              
              <p className="mb-16 text-2xl leading-relaxed text-gray-300">
                Kita menyediakan platform untuk membuat dan <br />
                mengembangkan Individu atau organisasi Pengembangan <br />
                Informatika yang berkinerja tinggi.
              </p>

              {/* CTA Buttons */}
              <div className="flex justify-center gap-4 mb-16">
                <motion.a
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  href="testing"
                  className="px-8 py-3.5 bg-[#9FEF00] text-gray-900 text-lg font-medium rounded-lg hover:bg-[#8CD600] transition-colors duration-300"
                >
                  Untuk Sekolah
                </motion.a>
                
                <motion.a
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  href="testing"
                  className="px-8 py-3.5 text-lg font-medium text-white border border-gray-700 rounded-lg hover:bg-gray-800/50 transition-all duration-300"
                >
                  Untuk Siswa
                </motion.a>
              </div>

              {/* Trial Banner */}
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.8, delay: 0.2 }}
                className="inline-flex items-center gap-3 px-6 py-3 transition-all duration-300 rounded-lg cursor-pointer hover:bg-gray-800/40 group"
              >
                <span className="px-2 py-1 text-xs font-semibold bg-[#9FEF00] text-gray-900 rounded">NEW</span>
                <span className="text-white">Start a 14-day business trial FOR FREE</span>
                <svg 
                  className="w-5 h-5 text-gray-400 transition-transform duration-300 transform group-hover:translate-x-1" 
                  fill="none" 
                  stroke="currentColor" 
                  viewBox="0 0 24 24"
                >
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
                </svg>
              </motion.div>
            </motion.div>
          </div>
        </div>
      </div>

      {/* Logo Carousel Section */}
      <div className="bg-[#0A1525] py-16">
        <div className="container px-8 mx-auto">
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.8 }}
            className="grid items-center grid-cols-3 gap-8 md:grid-cols-6"
          >
            <LogoCarousel />
          </motion.div>
        </div>
      </div>

      {/* Additional Sections */}
      <ContainerNews />
      <CyberIncidentsStats />
      <CybersecurityDashboard />
      <PreviewWeb />
      <WebsiteReview />
      <CoursesReview />
      <TestimonialsSection />
    </div>
  );
}

export default HomePage;
